import React from "react";
import "./drop.css";
export class Drop extends React.Component {
  render() {
    return (
      <select id="drop" className="drop">
        <option value='Julia'>Julia</option>
        <option value='Misha'>Misha</option>
        <option>Petr</option>
        <option>Martin</option>
      </select>
    );
  }
}
